import React from 'react';

function Post({ post }) {
    return (
        <div>
            <h3>{post.title}</h3>
            <p>{post.description}</p>
            {post.images && post.images.length > 0 && (
                <div>
                    {post.images.map((imageUrl, index) => (
                        <img key={index} src={imageUrl} alt={`Imagem ${index + 1}`} />
                    ))}
                </div>
            )}
        </div>
    );
}

export default Post;
